import React from 'react';
import './Nav-item.styles.scss'
import {useNavigate} from 'react-router-dom';

const NavItem = ({item, dropDownItems}) =>{
    const navigate = useNavigate();
    let path = item.toLowerCase();
    return (
        <li className = {`nav-item ${path}`} style={{ cursor:'pointer'}} onClick = {()=>navigate(`/${path}`)}>
            <a className = 'nav-link'>{item}</a>
            {dropDownItems ? 
                <div className='dropdown-menu'>
                {dropDownItems.map((ele) =><li class="nav-item dropdown">
                <a className="nav-link dropdown-toggle"
                ></a></li>)}

                </div>:''
            }
        </li>
    )
}

export default NavItem
